import React from "react";
import EventForm from "../components/EventForm";

const NewEvent = () => {
  return (
    <React.Fragment>
      <EventForm />
    </React.Fragment>
  );
};

export default NewEvent;

const addEventAction = ({ request, params }) => {
  const data = request.get.formData();
  const enterValue = {
    title: data.title,
    image: data.image,
    date: data.date,
    description: data.description,
  };
  const response = fetch("https://localhost:8080/events", {
    method: "POST",
    body: enterValue,
  });
};
